import styled from "styled-components";
import COLOR from "./COLOR";

const SearchContainer = styled.div`
    padding: 1.2rem 1.6rem;
    width: 44.8rem;
    height: 5.6rem;
    border: 0.1rem solid ${COLOR.GSD9};
    border-radius: 0.8rem;
    grid-column: 1/4;
    grid-row: 1/2;
`

function SearchBar () {
    return (
        <SearchContainer>

        </SearchContainer>
    )
}

export default SearchBar;
